import Menuitem from '../../menusitem/Menuitem';
import MenuItem from '../../menusitem/Menuitem';

function Menu() {
    return (
        <div className='sidebar'>
            <div className='sidebar_header'>
                <h4>Coding addict</h4>
            </div>
            <ul className='list'>
                <MenuItem/>
            </ul>

        </div>
    )
}
export default Menu;
